import React, { lazy, Suspense } from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import Loading from 'components/shared-components/Loading';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

export const AppViews = () => {
  return (
    <Suspense fallback={<Loading cover="content"/>}>
      <Switch>
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/home`} component={lazy(() => import(`./journeys/journey-ivr/home`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/dashboard`} component={lazy(() => import(`./journeys/journey-ivr/dashboard`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/dailyTracker`} component={lazy(() => import(`./journeys/journey-ivr/dailyTracker`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/taskTracker`} component={lazy(() => import(`./journeys/journey-ivr/taskTracker`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/transaction`} component={lazy(() => import(`./journeys/journey-ivr/transaction`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/journey-ivr/userRoles`} component={lazy(() => import(`./journeys/journey-ivr/userRoles`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/dashboard`} component={lazy(() => import(`./journeys/dashboard`))} />
        <Route path={`${APP_PREFIX_PATH}/journeys/progress`} component={lazy(() => import(`./journeys/progress`))} />
        <Route path={`${APP_PREFIX_PATH}/ops-admin`} component={lazy(() => import(`./ops-admin`))} />

        {/* Routes for CRM Project files */}
        {/* <Route path={`${APP_PREFIX_PATH}/crm/userRoles`} component={lazy(() => import(`./crm/userRoles`))} />
        <Route path={`${APP_PREFIX_PATH}/crm/dialogFlow`} component={lazy(() => import(`./crm/dialogFlow`))} />
        <Route path={`${APP_PREFIX_PATH}/crm/agentInfo`} component={lazy(() => import(`./crm/agentInfo`))} />
        <Route path={`${APP_PREFIX_PATH}/crm/campaignAssignment`} component={lazy(() => import(`./crm/campaignAssignment`))} />
        <Route path={`${APP_PREFIX_PATH}/crm/apr`} component={lazy(() => import(`./crm/apr`))} /> */}

        <Redirect from={`${APP_PREFIX_PATH}`} to={`${APP_PREFIX_PATH}/journeys/dashboard`} />
      </Switch>
    </Suspense>
  )
}

export default React.memo(AppViews);
